import{o as e,c as a,d as t}from"./app.f39506e2.js";const o='{"title":"Update Guide","description":"Update instructions for Warehouse Inventory Management Solution WIMS","frontmatter":{"title":"Update Guide","editLink":false,"head":[["meta",{"name":"description","content":"Update instructions for Warehouse Inventory Management Solution WIMS"}],["meta",{"name":"keywords","content":"WIMS, Warehouse Inventory, Warehouse Stock,"}]]},"headers":[{"level":3,"title":"Update Guide","slug":"update-guide"},{"level":2,"title":"Update Instructions","slug":"update-instructions"},{"level":2,"title":"Request Update","slug":"request-update"}],"relativePath":"update/index.md","lastUpdated":1618858007574}',d={},r=t('<h3 id="update-guide"><a class="header-anchor" href="#update-guide" aria-hidden="true">#</a> Update Guide</h3><p><strong><em>Please backup database and all files/folders before starting to update.</em></strong></p><h2 id="update-instructions"><a class="header-anchor" href="#update-instructions" aria-hidden="true">#</a> Update Instructions</h2><p>Please download the latest file and update the following files &amp; folder of your WIMS install:</p><ul><li><code>app/</code></li><li><code>database/</code></li><li><code>public/</code></li><li><code>resources/</code></li><li><code>routes/</code></li><li><code>vendor/</code></li><li><code>composer.json</code></li><li><code>composer.lock</code></li></ul><p>Now if you can login as <code>super admin</code> then you can visit <code>http://yourWIMSURL/update/database</code> otherwise you will need to update the database by running the following command from your main WIMS folder.</p><div class="language-bash line-numbers-mode"><pre><code><span class="token builtin class-name">cd</span> path/to/your/wims\nphp artisan app:update\n</code></pre><div class="line-numbers-wrapper"><span class="line-number">1</span><br><span class="line-number">2</span><br></div></div><h2 id="request-update"><a class="header-anchor" href="#request-update" aria-hidden="true">#</a> Request Update</h2><p>We encourage you to try updating yourself. However if you need update service, please open ticket for <em>Update Request</em> at <a href="https://tecdiary.net/support" target="_blank" rel="noopener noreferrer">Support Portal</a> (update fee $20 - $40) and provide your <code>license key</code> &amp; <code>server details</code> (access to files &amp; database). We will required 1 working day to perform update.</p>',9);d.render=function(t,o,d,n,i,s){return e(),a("div",null,[r])};export default d;export{o as __pageData};
